import { Component } from '@angular/core';
import { PPService } from "./pp.service";
import { UserInsertService } from './create_user.service'

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  nick_name=""
  description=""

  constructor(private userInsertService: UserInsertService){}

  public onSubmit(){
    const formData = new FormData();
    formData.append('nick_name', this.nick_name)
    formData.append('description', this.description)

    this.userInterface.postFormData (formData).subscribe(
      (error)=>{
        console.log(error);
      },
      (sucess)=> {
        console.log(sucess);
      }
      );
  }


}
<div>
    <form (submit)="onSubmit()">
        <input type="text" name="Nname" [(ngModel)]="nick_name">1
        <input type="text" name="description" [(ngModel)]="description">2
        <button>Select</button>
    </form>
</div>

<router-outlet></router-outlet>
